import { Button, Nav, Navbar } from "react-bootstrap"



const Header = () => {
    return (


              <Navbar bg="dark" variant="dark">
                <Navbar.Brand><Button>+</Button></Navbar.Brand>
                <Nav className="mx-auto text-white">
                  <h1 style={{marginTop: '70px', marginBottom: '70px'}}>Vega Project Admin</h1>
                </Nav>
              </Navbar>
            );
          }




export default Header
